def complement_dna_strand(dna_sequence):
    complement = {'A': 'T', 'T': 'A', 'C': 'G', 'G': 'C'}
    complemented_strand_list = []
    for nucleotide in dna_sequence:
        if nucleotide in complement:
            complemented_strand_list.append(complement[nucleotide])

    complemented_strand = ''.join(reversed(complemented_strand_list))
    return complemented_strand


